import React from "react";
import { Link } from "react-router-dom";
import "../styles/home.css";

function Home() {
  return (
    <div className="home">
      <video autoPlay loop muted className="background-video">
        <source src="/assets/video.mov" type="video/mp4" />
      </video>
      <div className="grid-container">
        <Link to="/about" className="grid-item about">
          <span>About</span>
        </Link>
        <Link to="/collections" className="grid-item collections">
          <span>Collections</span>
        </Link>
        <Link to="/contact" className="grid-item contact">
          <span>Contact</span>
        </Link>
        <Link to="/" className="grid-item home-link">
          <span>Home</span>
        </Link>
      </div>
    </div>
  );
}

export default Home;
